import React from 'react'
import {makeStyles} from '@material-ui/core/styles'
import { AppBar, Collapse, IconButton, Toolbar } from '@material-ui/core';
import SortIcon from '@material-ui/icons/Sort';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

const useStyles = makeStyles((theme) => ({
    appbar: {
        background: 'none',
        fontFamily: 'Quicksand'
    },
    icon:{
        color: '#fff',
        fontSize: '2rem'
    },
    appbarTitle:{
        flexGrow: '1',
    },
    appbarWrapper:{
        width:'80%',
        margin:'0 auto'
    },
    colorTitle:{
        color: '#FF1493'
    },
    root:{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
    },
    colorText1:{
        color: '#FFF',
        fontSize: '3rem',
        textAlign: 'center',
        fontFamily: 'Quicksand'
    },
    colorText2:{
        color: '#FF1493',
        fontSize: '3rem',
        textAlign: 'center',
        fontFamily: 'Quicksand'
    },
    expandIcon:{
        color: '#FF1493',
        fontSize: '4rem',
    }
}));

export default function Header(){
    const classes = useStyles()
    return(
        <div className={classes.root}>
            <AppBar className={classes.appbar} elevation={0}>
                <Toolbar className={classes.appbarWrapper}>
                    <h1 className={classes.appbarTitle}>
                        Your<span className={classes.colorTitle}>Music.</span>
                    </h1>
                        <IconButton>
                            <SortIcon className={classes.icon} />
                        </IconButton>
                </Toolbar>
            </AppBar>

            <Collapse in={true} {...(true ? { timeout: 1000 } : {})}>
            <div>
                <h1 className={classes.colorText1}>
                    My Music <br /> Your Music<br /><span className={classes.colorText2}>It's Our Music<span className={classes.colorText1}>.</span></span>
                    <br />
                    <IconButton>
                        <ExpandMoreIcon className={classes.expandIcon}/>
                    </IconButton>
                </h1>
            </div>
            </Collapse>

        </div>
    )
}
